import './App.css';
import {BrowserRouter as Router,Route,Switch,Link} from "react-router-dom";
import home from "./pages/home"
import Navbar from "./components/navbar"

function App() {
  return (
    <>
    <Navbar/>
    <Router>
        <Route path="/" exact render={home}/>
    </Router>
    </>
  )

}

export default App;
